import { Card, CardMedia } from '@mui/material'
import React from 'react'

const VideoCard = ({ video }) => {
return (
    <Card sx={{width: '320px', boxShadow: 'none', borderRadius: 0 }}>
        <CardMedia 
            imgage={video.snippet.thumbnails.high.url}
        />
    </Card>
)
}

export default VideoCard
